function FL_MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_)
  if SCUI_MessageUpdate(_ARG_0_, _ARG_1_, _ARG_2_, _ARG_3_, _ARG_4_) == true then
    return
  end
  if _ARG_0_ == UIEnums.Message.FriendError then
    FL_HandleError(_ARG_1_)
  end
  if Profile.FriendsListBusy() == true then
    return
  end
  if FL_KeyboardActive() == true then
    if _ARG_0_ == UIEnums.Message.Return and _ARG_2_ == true then
      FL_CloseKeyboard(true)
    elseif _ARG_0_ == UIEnums.Message.MenuBack and _ARG_2_ == true then
      FL_CloseKeyboard(false)
    end
  else
    if _ARG_0_ == UIEnums.Message.ButtonLeftShoulder and _ARG_2_ == true then
      FL_OpenKeyboard(true)
    elseif _ARG_0_ == UIEnums.Message.MenuBack and _ARG_2_ == true then
      Profile.CloseFriends()
    end
    if FL_GUI.can_select == true then
      if _ARG_0_ == UIEnums.Message.MenuNext and _ARG_2_ == true then
        if FL_GUI.accept_request == true then
          Profile.AcceptFriendRequest((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        elseif FL_GUI.can_join_in_progress == true then
          Profile.JoinSessionInProgress((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        end
      elseif _ARG_0_ == UIEnums.Message.ButtonX and _ARG_2_ == true then
        if FL_GUI.can_invite == true then
          Profile.SendGameInvite((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        end
      elseif _ARG_0_ == UIEnums.Message.ButtonRightShoulder and _ARG_2_ == true then
        if FL_GUI.accept_request == true then
          Profile.DeclineFriendRequest((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        elseif FL_GUI.revoke_request == true then
          Profile.CancelFriendRequest((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        elseif FL_GUI.can_select == true then
          Profile.RemoveFriend((UIButtons.GetFriendIndex(FL_GUI.friends_list_id)))
        end
      end
    end
  end
end
